CREATE EXTENSION IF NOT EXISTS "uuid-ossp";
CREATE EXTENSION IF NOT EXISTS CITEXT;

create table if not exists vehicledetails
(
    vin_id                              varchar(255) not null,
    mark                                varchar(255),
    manufactured_year                   integer,
    model_code                          varchar(255),
    type                                varchar(255),
    commercial_use                      varchar(255),
    modification                        varchar(255),
    wheel_formula                       varchar(255),
    wheel_tread                         varchar(255),
    overall_dimension                   varchar(255),
    largest_luggage_container_dimension varchar(255),
    wheel_base                          varchar(255),
    kerb_mass                           varchar(255),
    design__authorized_pay_load         varchar(255),
    design__authorized_towed_mass       varchar(255),
    design__authorized_total_mass       varchar(255),
    permissible_no_of_per_carried       integer,
    seat                                integer,
    stood_place                         integer,
    laying_place                        integer,
    type_of_fuel_used                   varchar(255),
    max_output                          varchar(255),
    rpm                                 integer,
    engine_displacement                 varchar(255),
    number_of_tires                     integer,
    tires_size__axle                    varchar(255),
    equipped_with_tachograph            boolean,
    equipped_with_camera                boolean,
    notes                               text
);

create table if not exists owners
(
    owner_id            uuid default uuid_generate_v4() not null,
    owner_type          varchar(255)                    not null,
    full_name           varchar(255)                    not null,
    address             varchar(255)                    not null,
    person_identity_number         varchar(255),
    tax_identity_number varchar(255)
);

create table if not exists vehicle
(
    registration_id       varchar(255) not null,
    registration_date     date         not null,
    place_of_registration varchar(255) not null,
    chassis_number        varchar(255) not null,
    engine_number         varchar(255) not null,
    vin_id                varchar(255) not null,
    manufactured_country  varchar(255) not null,
    manufactured_year     integer      not null,
    brand                 varchar(255) not null,
    model_code            varchar(255) not null,
    color                 varchar(255) not null,
    owner_id              uuid         not null
);



create table if not exists station
(
    station_id         serial,
    station_code       varchar(255),
    station_name       varchar(255) not null,
    province           varchar(255) not null,
    station_url        varchar(255),
    station_hotline    varchar(255),
    station_address    varchar(255),
    station_email      varchar(255),
    station_map_source varchar(255),
    station_manager    varchar(255) not null,
    station_status     boolean      not null
);

create table if not exists area
(
    province varchar(255) not null,
    area     varchar(255) not null
);


create table users
(
    user_id       uuid                        default uuid_generate_v4() not null,
    user_name     varchar(255)                                           not null
        unique,
    role          varchar(255),
    full_name     varchar(255),
    first_name    varchar(255),
    last_name     varchar(255),
    station_code  varchar(255),
    password      varchar(255)                                           not null,
    email         varchar(255)                                           not null,
    date_of_birth timestamp with time zone,
    gender        varchar(255),
    about         varchar(255),
    avatar        varchar(255),
    phone_number  varchar(255),
    identity_no   varchar(255),
    created_at    timestamp with time zone    default now(),
    updated_at    timestamp with time zone    default CURRENT_TIMESTAMP,
    login_date    timestamp(0) with time zone default CURRENT_TIMESTAMP
);



create table if not exists inspections(
    inspection_id   serial,
    registration_id varchar(255) not null,
    inspection_date date         not null,
    expiry_date     date         not null,
    station_code    varchar(255) not null
);



alter table inspections
    owner to postgres;

alter table inspections
    add primary key (inspection_id);





alter table vehicle
    owner to postgres;

alter table vehicle
    add primary key (registration_id);

alter table inspections
    add foreign key (registration_id) references vehicle;



alter table owners
    owner to postgres;

alter table owners
    add primary key (owner_id);

alter table vehicle
    add foreign key (owner_id) references owners;



alter table "users"
    owner to postgres;

alter table "users"
    add primary key (user_id);

alter table "users"
    add unique (user_name);



alter table area
    owner to postgres;

alter table area
    add primary key (province);



alter table station
    owner to postgres;

alter table station
    add primary key (station_id);

alter table station
    add unique (station_code);

alter table inspections
    add foreign key (station_code) references station (station_code);

alter table "users"
    add foreign key (station_code) references station (station_code);

alter table station
    add foreign key (province) references area;



alter table vehicledetails
    owner to postgres;

alter table vehicledetails
    add primary key (vin_id);

alter table vehicle
    add foreign key (vin_id) references vehicledetails;

